			   ( window.performance && window.performance.memory && window.performance.memory.usedJSHeapSize ) ||
			   ( window.webkitPerformance && window.webkitPerformance.memory && window.webkitPerformance.memory.usedJSHeapSize ) ||
			   0;

	},

