			}

		infoTable += '</table>';

		this.addContent(infoTable);


		//詳細テーブルに値を挿入 / 変更イベント追加
		var inputs = uuQuery('.softwareinstaller-app-info-table input[class^="softwareinstaller-appInfo-"]');

